import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the History navigation menu item to be visible
    await page.waitForSelector('.nav-item[data-page="history"]');

    // Click on the History navigation menu item
    await page.click('.nav-item[data-page="history"]');

    // Take screenshot after clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_clicked_history.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_clicked_history.png'));

    // Verify that the History page is displayed
    const isHistoryPageVisible = await page.isVisible('.main-content'); // Adjust selector as needed
    const extractedData = { historyPageVisible: isHistoryPageVisible };

    return {
      success: true,
      action: "Clicked on the History navigation menu item",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

